import Particles from "../Particles";
import { Wrapper, TypeWriterWrapper } from "./styles";
import Typewriter from "../Typewriter";

const Homepage = () => {
	return (
		<Wrapper>
			<TypeWriterWrapper>
				<span>Hi,</span>
				<span>I am Billy Joe</span>
				<Typewriter
					strings={[
						"Web Development",
						"Backend Development",
						"Mobile Development",
						"Continuous Integration",
						"Continuous Deployment"
					]}
				/>
			</TypeWriterWrapper>
			<Particles />
		</Wrapper>
	);
};
export default Homepage;
